// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import { Constant } from './Constant.sol';

contract MemberMatrix {
    enum Package { SPACE_1, SPACE_2, SPACE_3, SPACE_4, SPACE_5 }
    struct Member{
        address payable _creator;
        string _name;
        uint256 _created_at;
        uint256 _plain_pos;     // from left, dedicates pos in x-ray.
        uint256 _lv_pos;     // from top, dedicates level pos.

        mapping(uint => MemberMatrix) childMembers;
    }
    Member public _memberOwner;
    constructor (
        address payable creator,
        string memory name,
        uint256 created_at,
        uint256 plain_pos,
        uint256 lv_pos
    ) {
        _memberOwner._creator = creator;
        _memberOwner._name = name;
        _memberOwner._created_at = created_at;
        _memberOwner._plain_pos = plain_pos;
        _memberOwner._lv_pos = lv_pos;
    }

    function getName() public view returns(string memory) {
        return _memberOwner._name;
    }
}
